import "core-js/modules/es6.array.iterator";
import "core-js/modules/es6.promise";
import Vue from 'vue';
import Router from 'vue-router';
import HelloContainer from "./components/HelloWorld.vue";
import testContainer from "./components/testContainer.vue";
import Home from "./components/tabbar/Home.vue";
import Newslist from "./components/home/Newslist.vue";
import test_01 from "./components/test/test_01.vue";
import test_02 from "./components/test/test_02.vue";
import NewsInfo from "./components/home/NewsInfo.vue";
import GoodsList from "./components/goods/GoodsList.vue";
import GoodsInfo from "./components/goods/GoodsInfo.vue";
import swipe from "./components/sub/swiper.vue";
import Register from "./components/tabbar/Register.vue";
import Login from "./components/tabbar/Login.vue";
import ShopList from "./components/tabbar/ShopList.vue";
import add from "./components/sub/add.vue";
import Logout from "./components/home/Logout.vue";
Vue.use(Router);
export default new Router({
  routes: [{
    path: '/',
    redirect: "/Home"
  }, {
    path: '/test',
    component: testContainer
  }, {
    path: '/home',
    component: Home
  }, {
    path: '/Newslist',
    component: Newslist
  }, {
    path: '/test01',
    component: test_01
  }, {
    path: "/test02/:age",
    component: test_02
  }, {
    path: "/NewsInfo",
    component: NewsInfo
  }, {
    path: '/GoodsList',
    component: GoodsList
  }, {
    path: '/GoodsInfo/:id',
    component: GoodsInfo
  }, {
    path: '/swipe',
    component: swipe
  }, {
    path: "/Register",
    component: Register
  }, {
    path: "/Login",
    component: Login
  }, {
    path: "/ShopList",
    component: ShopList
  }, {
    path: '/add',
    component: add
  }, {
    path: '/Logout',
    component: Logout
  }]
});
